import React, { Component } from 'react';
import { Consumer } from '../../context';
import RecentTrackListItem from './RecentTrackListItem';
const recentlyPlayedCss = require('./recentlyPlayedTracks.scss');

 class RecentlyPlayedTracks extends Component {

  render() {

    return (

      <Consumer>
          {value => {
            const recentTracksList = value.recently_played_tracks;

            return (
              <React.Fragment>
                <section className="recently-played-tracks">
                <div className="view-switcher">
                  <h2>Recently Played Tracks</h2>  
                </div>

                  <ul className="recent-track-list">
                    {recentTracksList.map(item => (
                      <RecentTrackListItem key={item.index} track={item}/>
                    ))}
                  </ul>   



                </section>

              </React.Fragment>
            ); 
          }}
      </Consumer>
    )
  }
}
export default RecentlyPlayedTracks;
